var suggestions=document.getElementById('suggestions'),search=document.getElementById('search');search!==null&&document.addEventListener('keydown',inputFocus);function inputFocus(a){a.ctrlKey&&a.key==='/'&&(a.preventDefault(),search.focus()),a.key==='Escape'&&(search.blur(),suggestions.classList.add('d-none'))}document.addEventListener('click',function(a){var b=suggestions.contains(a.target);b||suggestions.classList.add('d-none')}),document.addEventListener('keydown',suggestionFocus);function suggestionFocus(c){const d=suggestions.classList.contains('d-none');if(d)return;const a=[...suggestions.querySelectorAll('a')];if(a.length===0)return;const b=a.indexOf(document.activeElement);if(c.key==="ArrowUp"){c.preventDefault();const d=b>0?b-1:0;a[d].focus()}else if(c.key==="ArrowDown"){c.preventDefault();const d=b+1<a.length?b+1:b;a[d].focus()}}(function(){var a=new FlexSearch.Document({tokenize:"forward",cache:100,document:{id:'id',store:["href","title","description"],index:["title","description","content"]}});a.add({id:0,href:"/docs/resource/resource/",title:"说明",description:"说明",content:"小欧在网上搜集的一些开源资源，希望能给你一些帮助。\n"}),a.add({id:1,href:"/docs/tool/tool/",title:"说明",description:"说明",content:"小欧在学习与工作中使用过的软件、工具推荐，观点来源于使用感受，如果你觉得不对，或者用什么不足的，欢迎指出讨论。\n"}),a.add({id:2,href:"/docs/vscode/vscode/",title:"说明",description:"VSCode 扩展分享",content:"VSCode 是小欧目前正在使用的IDE，近几年使用人数增长很快。这些扩展是小欧工作中使用过的，分享给诸位，希望能给你提升一点效率。\n扩展不在多，在于适用。\n部分扩展十分耗费资源，容易造成 VSCode 卡顿，另外很多扩展（如Bracket Pair Colorizer2）已被新版本 VSCode 内置，无需安装。\n"}),a.add({id:3,href:"/docs/vscode/yanzhi/",title:"颜值扩展",description:"VSCode 扩展分享，颜值党",content:"本期推荐几个颜值扩展，无关乎编程语言，IDE 更舒适，coding 更自如。\nvscode-icons   项目地址: https://marketplace.visualstudio.com/items?itemName=vscode-icons-team.vscode-icons\n 这个插件会根据文件后缀、名称显示不同的 icons，颜值颇高，设置后看着各种小图标心情舒畅，颜值党值得一试，如下图。（也可以自己设置喜欢的图标主题，扩展栏搜索 tag:icon-theme 安装你喜欢的即可）\nBetter Comments   项目地址: https://marketplace.visualstudio.com/items?itemName=aaron-bond.better-comments\n 美化注释必选，可以通过第一个字符区分不同的注释，也可以自定义，@和diy都是小欧自定义的，不同颜色也更方便区分不同级别的注释，好看又实用。\nindent-rainbow   项目地址: https://marketplace.visualstudio.com/items?itemName=oderwat.indent-rainbow\n 让缩进不再冰冷，像彩虹🌈一样绚烂。\n我的颜色配置如下：\n{ ... \u0026quot;indentRainbow.colorOnWhiteSpaceOnly\u0026quot;: false, \u0026quot;indentRainbow.colors\u0026quot;: [ \u0026quot;rgba(255,255,60,0.7)\u0026quot;, \u0026quot;rgba(127,255,127,0.7)\u0026quot;, \u0026quot;rgba(255,127,255,0.7)\u0026quot;, \u0026quot;rgba(60 90 170,0.4)\u0026quot; ], \u0026quot;indentRainbow.ignoreErrorLanguages\u0026quot;: [ \u0026quot;markdown\u0026quot; ], \u0026quot;indentRainbow.excludedLanguages\u0026quot;: [ \u0026quot;plaintext\u0026quot; ], \u0026quot;indentRainbow.includedLanguages\u0026quot;: [ ], \u0026quot;indentRainbow.indicatorStyle\u0026quot;: \u0026quot;light\u0026quot;, .... }  效果如图: 简体中文   项目地址: https://marketplace.visualstudio.com/items?itemName=MS-CEINTL.vscode-language-pack-zh-hans\n 适用于 VS Code 的中文（简体）语言包，无需多言。\nBetter Align   项目地址: https://marketplace.visualstudio.com/items?itemName=wwm.better-align\n 用=、:、=\u0026gt;对齐你的代码。它对逗号优先的编码样式和尾随注释有额外的支持+=,-=,*=,/=。\n需要注意的是，扩展没有内置快捷方式，您必须自己添加快捷键。\n比如：\n{ \u0026quot;key\u0026quot; : \u0026quot;ctrl+cmd+=\u0026quot;, \u0026quot;command\u0026quot;: \u0026quot;wwm.aligncode\u0026quot;, \u0026quot;when\u0026quot; : \u0026quot;editorTextFocus \u0026amp;\u0026amp; !editorReadonly\u0026quot; }  选择需要对其的代码，输入快捷键 ctrl+cmd+= ，即可看到效果(线上面的是格式过得，下面是未格式化的)。\nPower Mode   项目地址: https://marketplace.visualstudio.com/items?itemName=hoovercj.vscode-power-mode\n 这个安装后默认是不开启的，需要去配置enable一下，效果我就不贴了，插件项目地址页面有，可自行尝试，有点炫酷。（我比较喜欢Flame） 🔥🔥🔥🔥🔥🔥\n 还有像 Bracket Pair Colorizer2 等扩展在新版本的vscode 内置了，无需安装，更新下版本即可，我就不介绍了。\n颜值党的你是否有其他扩展推荐呢？不妨在评论区留言，分享给大家吧！\n"}),a.add({id:4,href:"/docs/vscode/",title:"VSCode 扩展",description:"VSCode 扩展分享",content:""}),a.add({id:5,href:"/docs/vscode/git%E6%8F%92%E4%BB%B6/",title:"Git 插件",description:"VSCode 扩展分享，VSCode Git 插件",content:"Git 想必在大家伙的日常开发中是必不可少的，本期给大家推荐几个 git 相关插件，希望能提高你的开发效率。\ngitignore   项目地址: https://marketplace.visualstudio.com/items?itemName=codezombiech.gitignore\n 如果你觉得写 gitignore 是个烦人的事情，那么你可以试试，安装后command+shift+P打开，就贸易选择 add gitignore 了。\n选择后具体语言后就会生成gitignore 文件啦。 Git History   项目地址: https://marketplace.visualstudio.com/items?itemName=donjayamanne.githistory\n 在某个文件里直接点击右键，就可以查看当前你文件的 git 历史了，相当方便。\nGit Graph   项目地址: https://marketplace.visualstudio.com/items?itemName=mhutchie.git-graph\n 安装完成后左下角有快捷菜单，点击后看查看自己的 git 提交，如图：\n可点击查看单词 commit 的明细：\ngithub   项目地址: https://marketplace.visualstudio.com/items?itemName=GitHub.vscode-pull-request-github\n 这个算是针对 github 的扩展，可以快捷的插件 github PR，操作课件如下图。  目前小欧用到比较多的是 git history 和 git graph，像其他的 gitlens 等插件使用不多，就不推荐了。\n如果您有其他 git 插件推荐，欢迎在评论区留言分享，感谢您的阅读。\n"}),a.add({id:6,href:"/docs/vscode/tips/",title:"效率提升",description:"VSCode 扩展分享，多项目切换必备",content:"​本期推荐几个效率提升工具，包括编码、多项目管理、debug方向的。\ncoding  Tabnine   项目地址: https://marketplace.visualstudio.com/items?itemName=TabNine.tabnine-vscode\n 这是个 AI 辅助插件，会根据你的 coding 去提示，根据提示，使用tab键补全，真香。\nchange-case   项目地址: https://marketplace.visualstudio.com/items?itemName=wmaurer.change-case\n 命名是个头疼的问题，change-case可以快速切换命名格式，比如驼峰、大小写切换、常量等。 debug  Code Runner   项目地址: https://marketplace.visualstudio.com/items?itemName=formulahendry.code-runner\n 这是小欧近期学习C++时发现的，可运行多种语言的代码片段，如 C, C++, Java, JavaScript, PHP, Python,, Go, Lua, Groovy, PowerShell, BAT/CMD, BASH/SH,, Visual Basic .NET, Clojure, Haxe, Objective-C, Rust, Racket, Scheme, AutoHotkey, AutoIt, Kotlin, Dart\u0026hellip;\u0026hellip;\n使用方法非常简单，光标在需要 debug 的文件中，然后 control+option+N，就可以 run code 啦！效果如图：（PS：你也可以自行定义命令。没错， \u0026ndash;std=c++11 就是小欧自定义的）\n多项目管理  Project Manager   项目地址: https://marketplace.visualstudio.com/items?itemName=alefragnani.project-manager\n 不知道大家在实际工作中，是否像小欧一样需要在多个项目间反复横跳。如果是这样，并觉得 VSCode 的下方历史项目操作起来略显繁琐，那么 project manager 绝对值得一试。\n安装完成后，左侧会有快捷选项卡，方便！！！可以点击上方修改图标自行配置，比如我的:​\n[ { \u0026quot;name\u0026quot;: \u0026quot;go-learning\u0026quot;, \u0026quot;rootPath\u0026quot;: \u0026quot;/Users/sai/Documents/github/go-learning\u0026quot;, \u0026quot;paths\u0026quot;: [], \u0026quot;tags\u0026quot;: [], \u0026quot;enabled\u0026quot;: true }, { \u0026quot;name\u0026quot;: \u0026quot;go-example\u0026quot;, \u0026quot;rootPath\u0026quot;: \u0026quot;/Users/sai/Documents/github/go-example\u0026quot;, \u0026quot;paths\u0026quot;: [], \u0026quot;tags\u0026quot;: [], \u0026quot;enabled\u0026quot;: true }, { \u0026quot;name\u0026quot;: \u0026quot;rust-learning\u0026quot;, \u0026quot;rootPath\u0026quot;: \u0026quot;/Users/sai/Documents/github/rust-learning\u0026quot;, \u0026quot;paths\u0026quot;: [], \u0026quot;tags\u0026quot;: [], \u0026quot;enabled\u0026quot;: true }, { \u0026quot;name\u0026quot;: \u0026quot;cpp-learning\u0026quot;, \u0026quot;rootPath\u0026quot;: \u0026quot;/Users/sai/Documents/github/cpp-learning\u0026quot;, \u0026quot;paths\u0026quot;: [], \u0026quot;tags\u0026quot;: [], \u0026quot;enabled\u0026quot;: true }, { \u0026quot;name\u0026quot;: \u0026quot;imgo\u0026quot;, \u0026quot;rootPath\u0026quot;: \u0026quot;/Users/sai/Documents/github/imgo\u0026quot;, \u0026quot;paths\u0026quot;: [], \u0026quot;tags\u0026quot;: [], \u0026quot;enabled\u0026quot;: true } ]  不仅如此，你还可以设置tag，项目太多时方便不同标记查看。\nProject Dashboard   项目地址: https://marketplace.visualstudio.com/items?itemName=kruemelkatze.vscode-dashboard\n 这也是个多项目管理的软件，可以设置不同的group，不同的颜色，还可以拖动项目更换group。操作简单，就不细说，效果如图： 标记  ​“冰冻三尺，非一日之寒”。很多时候，coding 是不能一蹴而就的，当你没有完成时，不妨使用下面的扩展来标记，防止遗忘。\nTODO Tree   项目地址: https://marketplace.visualstudio.com/items?itemName=Gruntfuggly.todo-tree\n TODO Tree 可以很方便地显示当前项目中所有的TODO所在的文件及位置，注意是大写的TODO哦，效果如图：（左侧也是有个选项卡快捷入口的）\nBookmarks   项目地址: https://marketplace.visualstudio.com/items?itemName=alefragnani.Bookmarks\n Bookmarks 可以设置给代码行设置标签，后续可以快速定位，适合未完成的、需要review 的 代码。\n"}),a.add({id:7,href:"/docs/vscode/tool/",title:"拓展工具",description:"VSCode 扩展分享，拓展工具",content:"VSCode 可不仅仅能编码，美化截图、制作流程图、数据库连接、emoji样样能干。\nCodeSnap   项目地址: https://marketplace.visualstudio.com/items?itemName=adpyke.codesnap\n CodeSnap 可以快速地生成代码快照，你看到的很多文章里的代码图片就是使用它生成的。使用简单，如图所见\ndrawio   项目地址: https://marketplace.visualstudio.com/items?itemName=hediet.vscode-drawio\n 不知道你有没有使用过 draw.io，安装这个插件你就可以在vscode使用 draw.io，可以制作流程图、思维导图，我新建了 oscome.drawio\n插件还支持这些文件 .drawio, .dio, .drawio.svg or .drawio.png\nMySQL   项目地址: https://marketplace.visualstudio.com/items?itemName=formulahendry.vscode-mysql\n MySQL 管理工具。\nemojisense   项目地址: https://marketplace.visualstudio.com/items?itemName=bierner.emojisense\n emojisense 支持快速添加 emoji 表情，增加 emoji ，让你的代码、文章更有趣。🐱 📡\nDocker   项目地址: https://marketplace.visualstudio.com/items?itemName=ms-azuretools.vscode-docker\n Docker 扩展使从 Visual Studio Code 构建、管理和部署容器化应用程序变得容易，甚至还提供容器内 Node.js、Python 的一键式调试。\n 除此之外，VSCode 还能跟 kubernetes、ElasticSearch 等进行交互操作。\n但不得不说的是，像 MySQL 这种扩展，我更建议使用专用的客户端，这些扩展纯查看还可以，但使用体验一般般而且如果开启了同步配置等功能，数据库、kubernetes 这类敏感还是要小心为上。\n"}),a.add({id:8,href:"/docs/tool/",title:"工具篇",description:"开源到，oscome，工具篇",content:""}),a.add({id:9,href:"/docs/resource/go/",title:"go",description:"go 开源资源，oscome 开源到",content:"基础  go 指南  https://tour.go-zh.org/list \n熟悉语法，可以直接 web 中运行。\nEffective Go  https://golang.google.cn/doc/effective_go\n可以理解为 go 指南的拓展，新手必备。如果习惯中文，可以看 https://learnku.com/docs/effective-go/2020\ngin docs  https://gin-gonic.com/zh-cn/docs/ \ngin 应该目前golang web api 领域使用者最多的了，docs提供了很多基础的例子，如果需要更多功能，可以基于业务和经验拓展。\n进阶  go设计模式  https://lailin.xyz/post/go-design-pattern.html\nGo 设计模式实现，作者很用心，适合学习语法后练习。\ngorm  https://gorm.io/zh_CN/docs/\n应该是golang最火热的orm库了，使用者众多，相信你迟早会用上的。\ngeektutu 的七天系列  https://github.com/geektutu/7days-golang\ngeektutu 的七天系列，质量很高。有一定难度，但有编程基础的go初学者跟着多练习会提升很多的，强烈推荐。\ngo-kit 微服务  https://www.hwholiday.com/categories/go-kit/\n适合学习 go-kit，设计知识面很广，jwt、etcd、hystrix。。。\n底层逻辑  go 语言设计与实现  https://draveness.me/golang/ \ndraveness 的这本书相当硬核，偏底层实现，为了深入了解go，值得多读几次。如果是为了面试，我也推荐你读读。\ngo语言原本  https://golang.design/under-the-hood/zh-cn/preface/\n也是大牛，也很硬核解析，\n优质博客   飞雪无情 峰云就她了  "}),a.add({id:10,href:"/docs/vscode/huashui/",title:"摸 🐟 鱼？不存在的",description:"VSCode 扩展分享，VSCode 摸鱼神器",content:"本期推荐 VSCode 放（摸）松（🐟）神器，上班和学习一样，要劳逸结合的哦 👍\n小霸王   项目地址: https://marketplace.visualstudio.com/items?itemName=gamedilong.anes\n 小霸王是一款基于vscode的nes游戏插件，能让你在紧张的开发之余在vscode里放松身心。选择想要玩的游戏，右键菜单下载。下载完成后，会加载到local菜单。点击即可玩起来。\n小霸王\u0026mdash;\u0026ndash;其乐无穷！！！但要记得戴耳机或者关闭外音哦！别问我是怎么知道的。。。\n韭菜盒子   项目地址: https://marketplace.visualstudio.com/items?itemName=giscafer.leek-fund\n VSCode 里也可以看股票 \u0026amp; 基金 \u0026amp; 期货实时数据，投资有风险，入市需谨慎！ ⏰s\n小欧并不建议初入股市的朋友打开实时查看，会三心二意的，bug连篇的。。。。。。\nZhihu On VSCode   项目地址: https://marketplace.visualstudio.com/items?itemName=niudai.vscode-zhihu\n 基于 VSCode 的知乎客户端，提供包括阅读，搜索，创作，发布等一站式服务。\n但不得不说，就我体验来说，有点儿卡，速度不快。\nCloudmusic   项目地址: https://marketplace.visualstudio.com/items?itemName=yxl.cloudmusic\n 网易云音乐插件，功能还蛮丰富的，直接登录账号即可，会同步歌单播客等信息，效果如图。（代码和音乐真的很配哦 💯 ）\nz-reader   项目地址:https://marketplace.visualstudio.com/items?itemName=aooiu.z-reader\n 用来摸鱼的小说阅读插件，支持在线搜索笔趣阁起点等，也支持本地阅读，支持 txt 和 epub 格式，效果如图。\nNBA real-time score   项目地址: https://marketplace.visualstudio.com/items?itemName=liyangjj.NBARealTimeScore\n 实时获取当天NBA比赛比分，并显示在vscode下方状态栏左侧；更可以观看实时文字直播，以及赛后数据统计。让你实现边 coding 边关注NBA。\n鼓励师系列  这个不过多介绍，可自行搜索。\n 摸鱼不可耻，但要适当哈! 🧑\n"}),a.add({id:11,href:"/docs/resource/php/",title:"php",description:"php 开源资源，oscome 开源到",content:"php 的学习一般可以从语法学起，然后是搭建环境，然后是框架，然后就可以搭建项目了，一般会涉及前端知识，也可以学习下。\n几年前觉得搭建环境是个麻烦事，如今docker、宝塔兴起后，搭建不费事。\n教程手册  php教程  https://www.runoob.com/php/php-tutorial.html\n熟悉语法使用，小欧个人还比较喜欢菜鸟的各个系列教程。w3school的也不错，https://www.w3school.com.cn/php/index.asp\nphp手册  http://www.php.net/manual/zh/ \nphper必备，适合作为手册使用，各种例子，新特性都有点。\npecl  http://pecl.php.net/\nphp 扩展仓库，相信你肯定用得到。\nPSR  https://www.php-fig.org/psr/\n非常建议以此为php编码标准，但很多phper不知道，强烈建议看看。\ncomposer中文文档  https://docs.phpcomposer.com/\nComposer 是 PHP 的一个依赖管理工具，现在的项目中几乎是必不可少的了。\n框架  Laravel 中文文档  https://learnku.com/docs/laravel/9.x\nLaravel 无需多言，功能十分强大。这个剖析文档也值得看看，https://learnku.com/docs/laravel-core-concept/5.5\nThinkPHP文档  https://www.kancloud.cn/manual/thinkphp6_0/1037479\nThinkPHP 也无需多言，国内使用者众。\nworkerman  https://www.workerman.net/doc/workerman/\n更底层更通用的服务框架，你可以用它开发tcp代理、梯子代理、做游戏服务器、邮件服务器、ftp服务器、甚至开发一个php版本的redis、php版本的数据库、php版本的nginx、php版本的php-fpm等等。\n如果想用php做个im，我推荐这个，曾经使用 workerman 成功运行。\nyii中文文档  https://www.yiichina.com/doc\nyii 也非常强大，插件式框架，国内使用者也非常多。\nswoole 文档  https://wiki.swoole.com/#/\nswoole 性能强大，如果遇到php瓶颈，可以尝试一下。\nhyperf 文档  https://hyperf.wiki/2.2/\n近几年很火的 swoole 框架。\n优质博客  风雪之隅  https://www.laruence.com/\nphp 核心开发者，大名鼎鼎的鸟哥，虽然他如今算是淡出 php 开发了，但是依旧关注 php 进展，博客有很多优质文章。\n优质论坛   https://learnku.com/  "}),a.add({id:12,href:"/docs/resource/rust/",title:"rust",description:"rust 开源书籍",content:"rust 正在学习中，如有好的学习资源，会继续更新。\n基础教程  rust 程序设计  https://doc.rust-lang.org/book/\n官网教程，也有中文版本https://kaisery.github.io/trpl-zh-cn/title-page.html\nrust 语言圣经  https://course.rs/about-book.html\n"}),a.add({id:13,href:"/docs/resource/",title:"开源资源",description:"开源到，oscome，开源资源",content:""}),a.add({id:14,href:"/docs/tool/markdown/",title:"Markdown 编辑器",description:"markdown 编辑器",content:"Markdown 是一种轻量级标记语言，创始人为约翰·格鲁伯（John Gruber）。 它允许人们使用易读易写的纯文本格式编写文档，然后转换成有效的 XHTML（或者HTML）文档。这种语言吸收了很多在电子邮件中已有的纯文本标记的特性。\nTypora   项目地址：https://www.typora.io/\n 相信在收费之前， Typora 的用户应该大有人在，小欧周边就有很多人在使用。\n我也曾是重度用户，文档基本都是 Typora + Github，使用感受一个字\u0026mdash;\u0026mdash;巴适。\n优点：\n 主题多，界面清爽 支持 pdf、html、image 导出（话说小欧的简历就是通过 Typora 的 Orangeheart 主题修改后制作的） 支持插入图片保存特定目录  缺点：\n 开始收费  Obsdian   项目地址：https://obsidian.md/\n Obsdian 是去年同事推荐给我的，功能十分强大，但是语法稍微有点不一样，可以通过配置去修改。\n优点：\n 双链强大而炫酷 免费 社区开放  缺点：\n 每个项目都要单独设置外观主题，狠繁琐  有道云笔记   项目地址： https://note.youdao.com\n 有道云笔记在很早的时候就支持 Markdown 了，而且支持多端，这个非常好，在前几年使用频率较高，但是windows版本软件时常出现卡死情况，一度只使用网页版本。\n优点：\n 多端云存储 依托有道云，功能不仅限于Markdown 可直接分享网页给朋友  缺点：\n 不开会员有广告 卡顿（曾经，近期使用频率不高）  作业部落   项目地址： https://www.zybuluo.com/\n 这是最早接触 Markdown 时使用的，应该至少2年没用过了，刚尝试登录了一下，发现还有80多篇文档。\n这有点惊到我了，必须给站长点赞。\n优点：\n 纯网页端，无需单独安装（也支持客户端了，难道是我曾经一直没发现😓） 支持标签分类  缺点：\n 上传本地文件需要升级至高级会员  VSCode   项目地址： https://code.visualstudio.com/\n 这是我写文章正在使用的，装了 Markdown All in One、Markdown Preview Enhanced 等扩展，对于 VSCode 重度使用者相当巴适，要啥自行车。\nPS：VSCode 貌似对各种语言支持越来越强，对于重度使用者来说，倒是非常不错的信息。\n优点：\n 依托于 VSCode，扩展众多  缺点：\n 导出功能较弱   以上是小欧自己深度使用过的 Markdown 编辑器，优缺点等言论也仅限于个人使用体验，仅供参考。如果你有其他好用的 Markdown 编辑器，不妨在评论区留言，分享给大家。\n"}),a.add({id:15,href:"/docs/tool/mindmapping/",title:"思维导图软件",description:"思维导图软件",content:"本期给大家推荐思维导图软件，一般也都支持流程图、组织架构图、UML等。\ndrawio   项目地址: https://app.diagrams.net/\n drawio 之前在推荐 VSCode 扩展曾提到过，免费且好用。\n第一次打开网站比较慢，因为国外资源且加载较多资源，稍稍等一会就好，用多了就没问题了，支持多种存储。\nProcessOn   项目地址：https://www.processon.com/\n ProcessOn 可用于原型图、UML、BPMN、网络拓扑图等多种图形绘制，另外还可以进行团队协同。但不开通会员注册后能文件最多可以保存 14 个（现在好像是9个），如果你使用频率不高（一月一两次），用这个绰绰有余啦，毕竟可以导入导出，导入的格式也支持很多，xmind、mmap 甚至是 excel。\n另外，ProcessOn 有了移动版，这个是值得称赞的。如果你受限于文件限制，可以开通会员，一般有优惠码大概100出头，年付！\n值得一提的是，你可以把好的图制作成模板，设置成付费。\nXMind   项目地址： https://xmind.cn/\n Xmind 应该是大家熟知的，毕竟做了十多年了，也足够好用。即使试用版本，也能应付一般的场景。导入支持 word、markdown等，同样支持团队协作，另外有教育特别优惠。\n百度脑图   项目地址： https://naotu.baidu.com/\n 印象中至少在六年前就有了，现在来看 UI 有点儿粗糙，但能用且不收费。\n亿图   项目地址: https://www.edrawsoft.cn/\n 不知道是记忆问题还是，感觉跟之前的界面大不一样了，一般使用场景试用版也够用了。\n总结  如果不想花钱，建议使用 drawio、Xmind ，如果不介意收费，ProcessOn 也是不错的选择，如果想赚钱，ProcessOn 社区，这个还是有难度的。\n你在使用什么工具画流程图、思维导图呢，不妨分享给大家？\n"}),a.add({id:16,href:"/docs/tool/google/",title:"谷歌插件分享",description:"谷歌插件分享",content:"本期推荐几个好用的谷歌插件。\n谷歌翻译  浏览网页时可轻松查看翻译版本。由Google翻译小组提供。\n在网页中选取需要翻译的段落、句子，右下角会有翻译图标，点击即可翻译，效果如图：\n二维码生成器 (Quick QR)  Chrome上好评率最高的二维码生成器：可以方便地把当前页面转化成二维码，也可以把网页上任何文本或链接，甚至是您输入的任意内容都转化成二维码。\n非常使用，比如想看手机版，点击后手机扫码即可，而且可以快速生成二维码分享给其他人，尤其适合 pc、mobile 切换查看的开发者使用。\nOneTab  工作中随着时间的推移，浏览页面越来越多，这时候点击onetab一键整理，所有tab变成一个了\u0026mdash;-舒适。效果如图：\n还可以查看之前onetab的保存记录，有点收藏夹的感觉，相当好用。\nInfinity 新标签页  标签页，自由添加网站图标，云端高清壁纸，快速访问书签、天气、笔记、待办事项、扩展管理与历史记录。\n大气又美观。\n有道云笔记网页剪报  如果你使用有道云，这个适合你，看到想收藏的网页，收藏到有道云，方便空闲时查看，这个非常贴心。\n关灯看视频  观看视频时自动调暗页面，让您仿佛置身于电影院中观看视频。\n小欧测试过，youtube、bilibili、爱奇艺都能使用。（当然了，如果不是摸鱼，体验最好的还是全屏）\n 后续有其他好用的谷歌插件，再开一期分享。你有什么好的推荐，不妨评论区分享给大家。\n"}),a.add({id:17,href:"/docs/tool/utool/",title:"效率工具 uTools",description:"效率工具 uTools",content:"简介  uTools 是一个插件式工具集合。安装之后，可以省去装其他很多应用，拥有丰富的插件市场，甚至连编程文档都有，十分强大。\n官网  https://u.tools/\n功能介绍  默认快捷键是 alt+space。可以自定义，出现是这么个样子的。\n一个简洁的导航栏。\n翻译  不用再去网页上翻译了，uTools帮你聚合了。（可能是谷歌翻译退出，所以没有了）\n文档  超级面板  长按右键即可打开，其实就是个快捷菜单，可以省去打字的时间。\n可以根据插件的关键字添加到超级面板，快速打开，这是我常用的插件。\n超级面板还可以支持语音，但如果是日常开发，可能没那么大用处。\n其他  插件很丰富，就不一一介绍了。\n 个人还是比较推荐的，难能可贵的是免费无广告，且支持mac、windows、linux，开发团队用心了。更多介绍： https://u.tools/\n"}),a.add({id:18,href:"/docs/",title:"软件扩展",description:"vscode插件，vscode扩展，软件扩展，来自开源到",content:""}),search.addEventListener('input',b,!0);function b(){var b,e;const d=5;b=this.value,e=a.search(b,{limit:d,enrich:!0});const c=new Map;for(const a of e.flatMap(a=>a.result)){if(c.has(a.doc.href))continue;c.set(a.doc.href,a.doc)}if(suggestions.innerHTML="",suggestions.classList.remove('d-none'),c.size===0&&b){const a=document.createElement('div');a.innerHTML=`No results for "<strong>${b}</strong>"`,a.classList.add("suggestion__no-results"),suggestions.appendChild(a);return}for(const[h,g]of c){const b=document.createElement('div');suggestions.appendChild(b);const a=document.createElement('a');a.href=h,b.appendChild(a);const e=document.createElement('span');e.textContent=g.title,e.classList.add("suggestion__title"),a.appendChild(e);const f=document.createElement('span');if(f.textContent=g.description,f.classList.add("suggestion__description"),a.appendChild(f),suggestions.appendChild(b),suggestions.childElementCount==d)break}}})()